        <div className="headerText col-md-5">
          <h1 className="text-bolt">
            Learn With Fun <br /> on any schedule
          </h1>
          <p>
            Lorem ipsum, dolor sit amet consectetur adipisicing elit. <br />{" "}
            Itaque reiciendis rem, nisi ratione quisquam inventore.
          </p>

          <button
            class=" btn"
            style={{
              padding: "10px",
