              backgroundColor: "green",
              color: "white",
            }}
          >
            JOIN US
          </button>
        </div>
        <div className="headerImage col-md-6">
          <img style={{ width: "80%", height: "100%" }} src={image} alt="" />
        </div>
      </main>
    </div>
  );
};

export default HeaderMain;
